import './App.css';
import {Form,Button} from "react-bootstrap";
import Navc from "./component/Navc";
function App() {
  return (
  <>
   <Navc/>
    <Form className="form-container w-75 m-auto " style={{ background:"lime", border: "1px solid black" ,margin: "5%"}}>
  <Form.Group className="mb-2 m-2" controlId="formBasicEmail">
    <Form.Label>Email address</Form.Label>
    <Form.Control type="email" placeholder="Enter email" />
  </Form.Group>

  <Form.Group className="mb-3 m-10" controlId="formBasicPassword">
    <Form.Label>Password</Form.Label>
    <Form.Control type="password" placeholder="Password" />
  </Form.Group>

  <Button variant="success" style={{textAlign: "center",margin:"auto", display: "flex"}} type="submit">
    Submit
  </Button>
</Form>
    </>
  )  
}

export default App;
